import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { Router } from '@angular/router';

@Component({
  selector: 'app-signup',
  templateUrl: './signup.component.html',
  styleUrls: ['./signup.component.css']
})
export class SignupComponent implements OnInit {
  registerForm!: FormGroup;
  showPassword: boolean = false;

  constructor(private fb: FormBuilder, private router: Router) {}

  ngOnInit(): void {
    this.registerForm = this.fb.group({
      email: ['', [Validators.required, Validators.email]],
      password: ['', [Validators.required, Validators.minLength(8), this.passwordValidator]]
    });
  }

  passwordValidator(control: any): { [key: string]: boolean } | null {
    const value = control.value;
    if (!/[A-Z]/.test(value) || !/\d/.test(value) || !/[\W_]/.test(value)) {
      return { invalidPassword: true };
    }
    return null;
  }

  onSubmit() {
    if (this.registerForm.valid) {
      console.log('Registration successful', this.registerForm.value);
      this.router.navigate(['/login']); // Redirect to login after registration
    }
  }

  togglePasswordVisibility() {
    this.showPassword = !this.showPassword;
  }
}
<div class="signup-container">
  <h2>Create Account</h2>
  <form (ngSubmit)="onSubmit()" [formGroup]="registerForm">
    <div class="form-group">
      <label for="email">Email</label>
      <input type="email" id="email" formControlName="email" placeholder="Enter your email" />
      <div *ngIf="registerForm.get('email')?.errors?.['required'] && registerForm.get('email')?.touched" class="error-message">
        * Email is required
      </div>
      <div *ngIf="registerForm.get('email')?.errors?.['email'] && registerForm.get('email')?.touched" class="error-message">
        * Enter a valid email
      </div>
    </div>

    <div class="form-group">
      <label for="password">Password</label>
      <input type="password" id="password" formControlName="password" placeholder="Enter your password" 
        [type]="showPassword ? 'text' : 'password'"/>
      <button type="button" (click)="togglePasswordVisibility()">{{showPassword ? 'Hide' : 'Show'}}</button>
      <div *ngIf="registerForm.get('password')?.errors?.['required'] && registerForm.get('password')?.touched" class="error-message">
        * Password is required
      </div>
      <div *ngIf="registerForm.get('password')?.errors?.['minlength'] && registerForm.get('password')?.touched" class="error-message">
        * Password must be at least 8 characters
      </div>
      <div *ngIf="registerForm.get('password')?.hasError('invalidPassword') && registerForm.get('password')?.touched" class="error-message">
        * Password must include at least one uppercase, one number, and one special character
      </div>
    </div>

    <button type="submit" [disabled]="registerForm.invalid">Create Account</button>
  </form>
</div>
